import React, { useState } from "react";
import "./teste.css";
export default function Teste() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  return (
    <div>
      <h1>TESTE</h1>

      <form>
        <input
          type="text"
          placeholder="Digite seu email..."
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        ></input>

        <input
          autoComplete={"false"}
          type="text"
          placeholder="******"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        ></input>

        <button type="submit">Acessar</button>
      </form>

      <div className="container">
        <div className="front">
          <img src="https://img.assinaja.com/upl/lojas/mundosinfinitos/imagens/foto-one-piece.png"></img>
        </div>
        <div className="back">
          <img src="https://upload.wikimedia.org/wikipedia/pt/f/fd/Opluffy.png"></img>
        </div>
      </div>
    </div>
  );
}
